import React from 'react';
import {TodoList} from './Components/TodoList'

function App() {
    const myTask =
        [
            "Yapılacak ilk iş"
        ];
    return (
        <div className="content">
            <TodoList myTask={myTask}/>
        </div>
    );
}

export default App;
